import React from "react";
import styled from "styled-components";
import { motion } from "framer-motion";

const HomeContainer = styled.div`
  text-align: center;
  padding: 50px;
`;

const Background = styled.div`
  background-image: url("/assets/home_pics01.jpg");
  height: 400px;
  background-size: cover;
  background-position: center;
`;

const Home = () => {
  return (
    <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 1 }}
    >
      <Background />
      <HomeContainer>
        <h1>Welcome to Golden Japan LLC</h1>
        <p>We export high-quality vehicles and offer premium services.</p>
      </HomeContainer>
    </motion.div>
  );
};

export default Home;
